import React from "react";

const Card = ({ bot, addBot }) => {

  return (
     <div >
      <div onClick={() => addBot(bot)}>

        <div >
          <img src={bot.avatar_url} />
        </div>

        <div>
          <div>
            {bot.name}  
          </div>
          <div >
            <small>{bot.catchphrase}</small>
          </div>
        </div>


        <div className="extra content">
          <span>
             {bot.health}
             {bot.damage}
             {bot.armor}
          </span>


            </div>
         </div>
     </div>
  );
};

export default Card;
